const Table=(props)=>{
    const {postData}=props
    const rows=postData.map((post)=>{
      return(
      <tr key={post.id}>
          <td>{post.first_name}</td>
          <td>{post.last_name}</td>
          <td>{post.address}</td>
      </tr>
      )
  })
    return(
    <div className='task-table'>
                <h1>Users({postData.length})</h1>
                <table>
        <tr>
         <th>First Name</th>
        <th>Last Name</th>
        <th>Address</th>
        


        </tr>
        <tbody>
                    {rows}    
        </tbody>
     </table>

            </div>
    )
}
export default Table;
